#define ll long long
int dx[]={1,-1,0,0,1,1,-1,-1};
int dy[]={0,0,1,-1,1,-1,1,-1};
const int inf = 1e9+7 , N = 1005,mod=1e9+7;
int n,m,p;
string a,b,c;
int dp[N][N];
int f (int i,int j){
     if(i == j) return 1;
     if(i > j) return 0;
     if(dp[i][j] != -1) return dp[i][j];
     int ans = 0;
     if(a[i] == a[j]){
          ans = 2 + f(i+1,j-1);
     }
     else{
          ans = max(ans,f(i+1,j));
          ans = max(ans,f(i,j-1));
     }
     return dp[i][j] = ans;
}
void solve(){

     cin >> a;
     n = a.length();
     memset(dp,-1,sizeof dp);
     cout << f(0,n-1)<<endl;
}
