ll fact(ll x)
{
    if (x == 1)
        return x;
    return x * fact(x - 1);
}
ll per(ll a, ll b)
{
    return fact(a) / fact(a - b);
}
ll com(ll a, ll b)
{
    return fact(a) / (fact(a - b) * fact(b));
}
