CREATE TABLE client_master (Client_no varchar2(5),Name varchar2(20) NOT NULL UNIQUE,Address1 varchar2(30),State varchar2(30),City varchar2(15), PRIMARY KEY(Client_no), CHECK(Client_no like 'C%'),CHECK(City in ('Delhi','Mumbai','Chennai')));
desc client_master;
CREATE TABLE product_master (Product_no varchar2(10),Description varchar2(20) NOT NULL UNIQUE,Qty_on_hand number(10),Sell_price number(8,2) NOT NULL,Cost_Price number(8,2) NOT NULL, CHECK(Product_no like 'P%'),CHECK(Qty_on_hand>10),PRIMARY KEY(Product_no));
desc product_master;
CREATE TABLE sales_order(S_Order_no varchar2(10),S_order_date date,Client_no varchar2(5),Salesman_no varchar2(10),Product_no varchar2(10),CHECK(S_order_no like 'O%'),CHECK(Salesman_no like 'S%'),FOREIGN KEY(Client_no) REFERENCES client_master(Client_no),PRIMARY KEY(S_order_no),FOREIGN KEY(Product_no) REFERENCES product_master(Product_no));
desc sales_order;
