using namespace std;

double eval(int *pj);

int *RandomSolutionGenerator() {
    int *solution = new int[100];

    for (int i = 0; i < 100; i++) {
        solution[i] = rand() % 2;
    }

    return solution;
}

double Evaluate(int *solution) {
    return eval(solution);
}

void Modify(int *solution) {
    int index = rand() % 100;
    solution[index] = 1 - solution[index];
}

void Modify(int *solution, double mutationRate) {
    for (int i = 0; i < 100; i++) {
        double randomVal = static_cast<double>(rand()) / RAND_MAX;

        if (randomVal < mutationRate) {
            solution[i] = 1 - solution[i];
        }
    }
}

void PrintSolution(int *solution) {
    for (int i = 0; i < 100; i++) {
        cout << solution[i];
    }

    cout << endl;
}

void RunIterations(int start, int end, int *solutionNew, double &fitnessBase, bool &done) {
    for (int i = start; i < end; i++) {
        int number = i; // Replace with your integer value
        int numBits = 30; // Number of bits for a 30-bit binary representation

        std::bitset<30> binaryRepresentation(number);

        for (int j = 0; j < numBits; ++j) {
            solutionNew[j] = binaryRepresentation[numBits - 1 - j];
        }
        double fitnessNew = Evaluate(solutionNew);

        cout << "Iteration: " << i << " Fitness: " << fitnessNew << endl;
        if (fitnessNew >= 100) {
            done = true;
            fitnessBase = fitnessNew;
            break;
        }
    }
}

int main() {
    srand(time(0));

    int *solutionBase = RandomSolutionGenerator();
    double fitnessBase = Evaluate(solutionBase);

    bool done = false;
    int *solutionNew;

    while (!done) {
        solutionNew = new int[100];

        for (int i = 0; i < 100; i++) {
            solutionNew[i] = solutionBase[i];
        }

        Modify(solutionNew, 0.01);

        double fitnessNew = Evaluate(solutionNew);

        cout << fitnessNew << endl;

        if (fitnessNew >= fitnessBase) {
            delete[] solutionBase;
            solutionBase = solutionNew;
            fitnessBase = fitnessNew;
        }

        if (fitnessNew >= 70) {
            done = true;
            PrintSolution(solutionNew);
        }
    }

    // Number of threads you want to use
    int numThreads = std::thread::hardware_concurrency();
    int iterationsPerThread = 1073741823 / numThreads;
    std::vector<std::thread> threads;

    for (int i = 0; i < numThreads; i++) {
        threads.emplace_back(RunIterations, i * iterationsPerThread, (i + 1) * iterationsPerThread, solutionNew, fitnessBase, std::ref(done));
    }

    for (auto &thread : threads) {
        thread.join();
    }

    delete[] solutionBase;

    return 0;
}

function fetchWithAuthorization(url, options) {
    const token = sessionStorage.getItem("access_token"); // Get the token from sessionStorage
    
    const headers = new Headers(options.headers || {});
    headers.append("Authorization", `Bearer ${token}`); // Include the token in the Authorization header

    options.headers = headers;

    return fetch(url, options);
}

