class Solution {
  public:
    bool canPair(vector<int> nums, int k) {
        // Code here.
       unordered_map<int,int> m;
       for(int i=0;i<nums.size();i++)
       {
           m[nums[i]%k]++;
       }
       for(int i=0;i<nums.size();i++)
       {
           int rem=nums[i]%k;
           if(2*rem == k)
           {
              if(m[rem]%2!=0)
              {
                  return false;
              }
           }
           else if(rem==0)
           {
               if(m[rem]&1)
               {
                   return false;
               }
           }
           else if(m[rem]!=m[k-rem])
           {
               return false;
           }
           
           
       }
       return true;
    }
};

