class Solution{
  public:
    vector <int> countDistinct (int A[], int n, int k)
    {
        
        vector<int> v;
        int K=k;
        int N=n;
    unordered_map<int, int> hm;
 
    
    int dist_count = 0;

    for (int i = 0; i < K; i++) {
        if (hm[A[i]] == 0) {
            dist_count++;
        }
       
        hm[A[i]] += 1;
    }
 

     v.push_back(dist_count);
 
    
    for (int i = K; i < N; i++) {
       
        if (hm[A[i - K]] == 1) {
            dist_count--;
        }
        
        hm[A[i - K]] -= 1;
 
        
 
        if (hm[A[i]] == 0) {
            dist_count++;
        }
        hm[A[i]] += 1;
 
       
       v.push_back(dist_count);
    }
    return v;
    }
};

